import React, { Component } from 'react'
import bennydp from '../../images/benny_dp.png'
import justindp from "../../images/justin_dp.jpg"

export default class Team extends Component {
    render() {
        return (
            <div>
                <img src={bennydp} alt="" style={{
                    width: '300px'
                }}/>
                <img src={justindp} alt=""style={{
                    width: '300px'
                }}/>
            </div>
        )
    }
}
